import React from 'react';
import './App.css';
import { GoogleMapComponent, NavBar } from './routes'


class App extends React.Component {
  render() {
  return (
    <div className="App">
      <NavBar />
      <GoogleMapComponent />
    </div>
  );
}
}

export default App;
